#include <bits/stdc++.h>
#define int long long
using namespace std;
void solve(vector<int> dd)
{
    int l, r, sum = 0;
    cin >> l >> r;
    for (int i = 0; i < dd.size(); i++)
    {

        if(dd.operator[](i)<=r && dd.operator[](i)>=l)
        {
             sum++;
        }


    }
       cout << sum << endl;
}
int32_t main()
{
    vector<int> dd;
    for(int i=0; i<=19; i++)
    {
        if(i<10 || (i>9 && i%2==0))
        {
            dd.push_back(i);
        }
    }
    int i = 10, n = (int) 1e18+1000, k = 10, dar = 2, xona = 100;

    while(k <= n)
    {
        dd.push_back(dd[i]*dar);
        k = dd[i] * dar;
        i += 1;
        if(xona < dd[i]*dar)
        {
            dar++;
            i = 1;
            while(xona > dd[i]*dar)
            {
                i++;
            }
            xona *= 10;

        }

    }
    int t;
    cin>>t;
    while(t--)
    {
        solve(dd);
    }
    return 0;
}
